sys_variable_value.value:
(function execute(inputs, outputs) {

  var hash = {}
  hash.id = inputs.armis_id
  hash.apps = inputs.apps
  hash.key_atts = inputs.key_attributes
  hash.prop = inputs.properties

  outputs.json = JSON.stringify(hash)

})(inputs, outputs);

